import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
    const navigate = useNavigate();
    const isAuthenticated = !!localStorage.getItem('adminToken');
    const adminUsername = localStorage.getItem('adminUsername');

    const handleLogout = () => {
        localStorage.removeItem('adminToken');
        localStorage.removeItem('adminUsername');
        navigate('/admin/login');
    };

    return (
        <nav className="bg-blue-600 text-white shadow-lg">
            <div className="container mx-auto px-6 py-3">
                <div className="flex items-center justify-between">
                    <div className="flex items-center">
                        <span className="text-xl font-semibold">
                            Blockchain User Data Manager
                        </span>
                    </div>

                    <div className="flex items-center space-x-4">
                        <Link to="/" className="hover:text-blue-200 transition-colors">
                            Save Data
                        </Link>
                        <Link to="/fetch" className="hover:text-blue-200 transition-colors">
                            Fetch Data
                        </Link>
                        {isAuthenticated ? (
                            <>
                                <Link to="/admin" className="hover:text-blue-200 transition-colors">
                                    Admin Portal
                                </Link>
                                <div className="flex items-center space-x-2">
                                    <span className="text-sm text-blue-200">
                                        Welcome, {adminUsername}
                                    </span>
                                    <button
                                        onClick={handleLogout}
                                        className="bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded-md text-sm transition-colors"
                                    >
                                        Logout
                                    </button>
                                </div>
                            </>
                        ) : (
                            <Link
                                to="/admin/login"
                                className="bg-blue-500 hover:bg-blue-700 text-white px-3 py-1 rounded-md transition-colors"
                            >
                                Admin Login
                            </Link>
                        )}
                    </div>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
